    function alerta(titulo, msj){
        if (Notification) {
            if (Notification.permission !== "granted") {
                Notification.requestPermission()
            }
            var title = titulo;
            var extra = {
                icon: "data:image/png;base64,",
                body: msj
            }
            var noti = new Notification(title, extra)
            noti.onclick = {
                // Al hacer click
            }
            noti.onclose = {
                // Al cerrar
            }
            // Cerrar Automaticamente luego de 1000 Segundos.
            setTimeout(function () {
                noti.close()
            }, 10000)
            //new Audio('alert.mp3').play();
        }
    }

    /* Funcionalidades de las notificaciones */
    function informar(mensaje, titulo) {
        Command: toastr["info"](mensaje, titulo);
    }

    function alertar(mensaje, titulo) {
        Command: toastr["success"](mensaje, titulo);
    }

    function mostrarError(mensaje, titulo) {
        Command: toastr["error"](mensaje, titulo);
    }
    function mostrarBug(mensaje, titulo) {
        Command: toastr["warning"](mensaje, titulo);
    }

    function notificar(mensaje, titulo) {
        alerta(titulo,mensaje);
    }
    // Opcioens globales del la parte de notificar
    toastr.options = {
        "closeButton": true,
        "debug": false,
        "newestOnTop": true,
        "progressBar": true,
        "positionClass": "toast-top-right",
        "preventDuplicates": false,
        "onclick": null,
        "showDuration": "600",
        "hideDuration": "1000",
        "timeOut": "5000",
        "extendedTimeOut": "1000",
        "showEasing": "swing",
        "hideEasing": "linear",
        "showMethod": "fadeIn",
        "hideMethod": "fadeOut"
    }



